import React from 'react';
import {NavLink} from 'react-router-dom';
import img1 from '../Images/img1.png';
import Same from './Same';

const About=()=>{
    return(
        <>
        <Same
        title="Know more about us"
        text="
        1. Pengajar GO mampu menuntaskan soal-soal seleksi seperti PTS/PAS/PAT dan UTBK/UM melalui pendekatan konsep dasar dan The King. 
        2. Pengajar GO mampu memberikan penjelasan detail tentang pelajaran kepada siswa sehingga siswa benar-benar paham dan mengerti. 
        3. Pengajar GO lulusan dari perguruan tinggi terkemuka di Indonesia maupun internasional serta mampu bersikap professional.

        
        " 
        imgsrc={img1}
        btn="Know more"
        />
        </>
    )
}
export default About;
